import React from 'react';
import logo from '../images/logo1.jpg'

const About = () => {
    return (
        <>
            <div className="container profile">
                <form method=''>
                    <div className="row">
                        <div className="col-md-4">
                            <img src={logo} alt="." width="50" height='50'/>
                        </div>
                    </div>
                </form>
            </div>
        </>
    );
}

export default About;
